pub enum ExecuteMsg<T> {
    Register {
        id: String,
        owner: String,
        duration: u64,
        name: String,
    },
    AddController {
        address: String,
    },
    RemoveController {
        address: String,
    },
    SetConfig {
        grace_period: u64,
        registry_address: String,
        owner: String,
    },
    Renew {
        id: String,
        duration: u64,
    },
    Reclaim {
        id: String,
        owner: String,
    },
    TransferNft {
        recipient: String,
        token_id: String,
    },
    SendNft {
        contract: String,
        token_id: String,
        msg: Binary,
    },
    Approve {
        spender: String,
        token_id: String,
        expires: Option<Expiration>,
    },
    Revoke {
        spender: String,
        token_id: String,
    },
    ApproveAll {
        operator: String,
        expires: Option<Expiration>,
    },
    RevokeAll {
        operator: String,
    },
    Mint(MintMsg<T>),
}

